import styled from "styled-components";

export const DirectoryMenuContainer = styled.div`
  display: flex;
  justify-content: center;
  background-color: white;
  flex-wrap: wrap;
  z-index: 999;
  border: black solid 5px;
  border-radius: 25px;
  padding: 33px;
`;
